// react must be required before jquery and app framework to be able to stop event propagation
// See http://stackoverflow.com/questions/24415631/reactjs-syntheticevent-stoppropagation-only-works-with-react-events
require(['jquery', 'appframework', 'fastclick',
        'scripts/StateManager', 'scripts/IndexManager', 'scripts/ExerciseManager',
        'scripts/components/CircularTimer',
        'scripts/components/Exercises',
        'scripts/components/ExercisesHeader',
        'scripts/components/ExercisesController',
        'scripts/components/Index',
        'scripts/components/Menu',
        'react'],
        function ($, appframework, FastClick,
                  StateManager, IndexManager, ExerciseManager,
                  CircularTimer,
                  Exercises,
                  ExercisesHeader,
                  ExercisesController,
                  Index,
                  Menu,
                  React) {
    $.afui.ready(function () {
        $.afui.useInternalRouting = true;
        $.afui.setBackButtonVisibility(false);
        $.afui.manageHistory=false;
        $.afui.enableTabBar();
        FastClick.attach(document.body);


        $.feat.nativeTouchScroll=true;

        $.afui.launch();

        function renderExercises(source) {
            var context = { rootUri: source.substring(0, source.lastIndexOf( "/" )) };
            $.get(source + "?v=" + Math.random().toString(), function (exercisesMarkdown) {
                $.afui.hideMask();
                var exerciseManager =  new ExerciseManager(source, exercisesMarkdown, this.rootUri);
                // For now: autostart
                exerciseManager.start();
                renderExercise(exerciseManager);
            }.bind(context));
        }

        function renderExercise(exerciseManager) {
            React.render(React.createElement(ExercisesHeader, {key: "exerciseHeader", exerciseManager: exerciseManager}), document.getElementById('mountAppHeader'));
            React.render(React.createElement(Exercises, {key: "exercises", exerciseManager: exerciseManager, stateChanged: renderExercise}), document.getElementById('mountExercisesViewer'));
            React.render(React.createElement(ExercisesController, {key: "exercisesController", exerciseManager: exerciseManager}), document.getElementById('mountExercisesController'));
        }

        function renderApp(state) {
            React.render(React.createElement(Menu, {key: "menu", indices: state.indices, handle: renderExercises}), document.getElementById('mountIndexLeftMenu'));
            if (!!state.manager) {
                renderExercise(state.manager);
            }
        }

        var state = new StateManager("TrainerCoach", renderApp);
    });
});
